import Card from "react-bootstrap/Card";

function Trip() {
  return (
    <>
      <Card
        style={{
          margin: "15px 15px 15px 15px",
          // display: "flex",

          // width: "18rem",
        }}
      >
        <Card.Header style={{ padding: "0px 0px 0px 0px" }}>
          <img
            className="icon"
            src={thing.url.includes("ebay") ? logoe : logoc}
          />
        </Card.Header>
        <Card.Body style={{ justifyContent: "center", alignItems: "center" }}>
          <Card.Title>{thing.name}</Card.Title>
          <Card.Text>${thing.price.toFixed(2)}</Card.Text>
          <a
            style={{ display: "flex" }}
            href={thing.url}
            target="_blank"
            rel="noreferrer"
          >
            <div
              style={{
                background: `url(${thing.img})`,
                height: "200px",
                width: "100%",
                backgroundRepeat: "no-repeat",
                backgroundSize: "cover",
              }}
              variant="top"
              onError={(e) => {
                console.log("errored")(
                  (e.target.style = {
                    background: `url(${noimg})`,
                    height: "200px",
                    width: "100%",
                    backgroundRepeat: "no-repeat",
                    backgroundSize: "cover",
                  })
                );
              }}
            />
          </a>
        </Card.Body>

        <Card.Footer>
          {type === "trackedsearches" ? (
            <SaveItemForm api={api} thing={thing} user={user} />
          ) : (
            <button data-id={thing.id} onClick={handleDeleteItem} role="img">
              ‚ùå
            </button>
          )}
        </Card.Footer>
      </Card>
    </>
  );
}

export default Trip;
